import React from 'react'

const LogIn = async () => {
    
  return (
    <div>
        <from>
            <input type="text" placeholder='email'></input>
            <input type="password" placeholder='password'></input>
            <input type="submit">LogIn</input>
        </from>
    </div>
  )
}

export default LogIn
